Creation_tips1:
ไม่สามารถเปิดใช้ “การกู้คืนความละเอียดสูง” ได้ในขณะนี้ โปรดตรวจสอบว่าคุณได้ตั้งค่าดังต่อไปนี้:
1. อัปโหลดภาพในโมดูล “ภาพต่อภาพ”;
2. เลือก “โหมด” ที่ไม่ใช่ “ค่าเริ่มต้น”;
3. เพิ่ม “เครือข่ายควบคุม”;
โปรดยกเลิกการตั้งค่าข้างต้นแล้วลองใหม่อีกครั้ง

Creation_tips3:
ไม่สามารถใช้โหมด “SeaArt 2.0” หรือ “SeaArt 2.1” ได้ในขณะนี้ โปรดตรวจสอบว่าคุณได้ตั้งค่าดังต่อไปนี้:
1. อัปโหลดภาพในโมดูล “ภาพต่อภาพ”;
2. เพิ่ม “เครือข่ายควบคุม”;
โปรดยกเลิกการตั้งค่าข้างต้นแล้วลองใหม่อีกครั้ง

Creation_tips12:
ไม่สามารถเพิ่ม "การแจ้งเตือนภาพ" ชั่วคราวได้ กรุณาตรวจสอบว่าคุณได้ตั้งค่าต่อไปนี้: 
1. อัปโหลดภาพในโมดูล "ภาพเป็นภาพ" แล้ว; 
2. เพิ่ม "เครือข่ายควบคุม" แล้ว; 
. กรุณายกเลิกการตั้งค่าเหล่านี้แล้วลองใหม่อีกครั้ง

Creation_tips15:
ไม่สามารถเปิดใช้งาน "มนต์เสริมพลัง" ชั่วคราวได้ กรุณาตรวจสอบว่าคุณได้ตั้งค่าต่อไปนี้: 
. อัปโหลดภาพในโมดูล "ภาพเป็นภาพ" แล้ว; 
2. เพิ่ม "เครือข่ายควบคุม" แล้ว; 
. กรุณายกเลิกการตั้งค่าเหล่านี้แล้วลองใหม่อีกครั้ง

Creation_tips25:
"การปรับปรุงความละเอียดสูง" ไม่สามารถเปิดใช้งานได้ชั่วคราว กรุณาตรวจสอบว่าคุณได้ตั้งค่าตามนี้แล้วหรือยัง:
1. เลือกโมเดล SA หรือชั้นพื้นฐานเป็นโมเดล Flux;
2. เพิ่ม "ภาพเป็นภาพ" หรือ "ControlNet";
3. เปิดใช้งาน "การเพิ่มประสิทธิภาพอนิเมะ";
4. เอ็นจิ้นที่เลือกไม่ใช่ "ค่าเริ่มต้น" กรุณายกเลิกการตั้งค่าข้างต้นแล้วลองใหม่อีกครั้ง

